#트레이너와 헬스 유저간의 공통된 정보를 기록하기 위한 테이블입니다.
#등록된 계정의 정보는 모두 난수 생성을 이용하여 만들어졌습니다.

CREATE TABLE user (
  id varchar(20) NOT NULL,
  password varchar(64) NOT NULL,
  name char(20) NOT NULL,
  age int(11) NOT NULL,
  checkid tinyint(1) NOT NULL,
  sex varchar(4) NOT NULL,
  phonenumber char(30) NOT NULL,
  PRIMARY KEY(id),
  UNIQUE KEY id(id)
);

